    UNION
    {
        SELECT ?reference ?party
        WHERE {
            dbpedia:Romano_Antonio_Prodi rdf:type dbo:Person ;
                                        rdf:type dbo:OfficeHolder ;
                                        rdf:type dbo:Politician ;
